(1290, 'Introduction to JavaScript + Setup | JavaScript Tutorial in Hindi #1', '<p>Link to the Repl - <a href=\"https://replit.com/@codewithharry/01IntroductiontoJs\" target=\"_blank\">https://replit.com/@codewithharry/01Intr...</a><br />\nJoin Replit - <a href=\"https://join.replit.com/CodeWithHarry\" target=\"_blank\">https://join.replit.com/CodeWithHarry</a><br />\nDownload Notes - <a href=\"https://drive.google.com/drive/folders/1RcyvvOAxJtNc_mPLt9g-kTHIMUZ3uD8z?usp=sharing\" target=\"_blank\">https://drive.google.com/drive/folders/1...</a><br />\nBookmark and save the playlist: <a href=\"https://www.youtube.com/playlist?list=PLu0W_9lII9ahR1blWXxgSlL4y9iQBnLpR\" target=\"_blank\">https://www.youtube.com/playlist?list=PL...</a><br />\nTimeStamps: <br />\n00:00-01:07 (Introduction)<br />\n01:07-04:09 (Introduction to programming) <br />\n04:09-06:07 (Ecmascript)<br />\n06:07-08:34 (How to execute javascript code)<br />\n08:34-13:00 (Replit)<br />\n13:00-13:45 (Discussion)<br />\n►Checkout my English channel here: <a href=\"https://www.youtube.com/channel/UC7btqG2Ww0_2LwuQxpvo2HQ\" target=\"_blank\">https://www.youtube.com/channel/UC7btqG2...</a><br />\n►Instagram: www.instagram.com/codewithharry<br />\n<br />\npython, C, C++, Java, JavaScript, and Other Cheetsheets [++]:<br />\nPlaylist: <a href=\"https://www.youtube.com/playlist?list=PLu0W_9lII9agrsRZjFECeFuWY5ev2pQlk\" target=\"_blank\">https://www.youtube.com/playlist?list=PL...</a><br />\n<br />\n►Learn in One Video[++]:<br />\nPython[15 Hr] - <a href=\"https://www.youtube.com/watch?v=gfDE2a7MKjA&list=PLu0W_9lII9ahKZ42vg2w9ERPmShYbYAB7\" target=\"_blank\">https://www.youtube.com/watch?v=gfDE2a7M...</a><br />\nPython Advance[3.5 Hr] - <a href=\"https://www.youtube.com/watch?v=61a7UkDO50s&list=PLu0W_9lII9ahKZ42vg2w9ERPmShYbYAB7\" target=\"_blank\">https://www.youtube.com/watch?v=61a7UkDO...</a><br />\nPython[1 Hr] - <a href=\"https://www.youtube.com/watch?v=qHJjMvHLJdg&list=PLu0W_9lII9ahKZ42vg2w9ERPmShYbYAB7\" t