(1476, 'Baap Numbri Beta Dus Numbri Full Movie | Jackie Shroff | Kader Khan Hindi Comedy Movie|Shakti Kapoor', '<p>Hindi Comedy Movie Baap Numbri Beta Dus Numbri (1990) Bollywood Comedy Movie.<br />\nStarring: Jackie Shroff, Aditya Pancholi, Farha, Kader Khan, Shakti Kapoor, Gulshan Grover.<br />\nProducer: Iqbal Baig, Director: Aziz Sajawal<br />\n<br />\nSynopsis: Raman (Kader Khan) an incorrigible cheat grooms his son Prasad (Shakti Kapoor) in his trade. Master conmen they swindle everybody including Ramans widowed sister Gayatri (Anjana Mumtaz). She is sent to a mental asylum and her son Ravi is abandoned. Ravi grows up to become a local bully Ravi Dada (Jackie Shroff), who extorts money to support his foster sister Anitas (Sabeeha) studies. Ravis competition in the extortion racket Rozy (Farha), but both soon fall in love. Anitas fiancee Anil (Aditya Pancholi) meets Gayatri and brings her home and swears to bring Raman to book. Raman hires Ravi to finish him off. But when Ravi realizes his blunder he repents. Gayatri reunites with her son. Now the threesome of Ravi, Rozy and Anil gang up against the father and son duo on one hand and on the other, swoop down upon Gullu Maharaj (Gulshan Grover), who had exterminated Ravis father - a honest Customs sleuth Pratap Singh (Vijay Arora), a Rozys father DSouza (Bharat Bhushan), who had been killed while trying to save Pratap Singh. A war of wits thus ensues and culminates into an explosion of tummy-tickling laugh riot, a climax extraordinaire!<br />\n<br />\n► Watch Superhit Bollywood Movies - <a href=\"https://bit.ly/-BollywoodMovies\" target=\"_blank\">https://bit.ly/-BollywoodMovies</a><br />\n<br />\n► Watch Superhit Hindi Movies - <a href=\"https://bit.ly/-HindiMovies\" target=\"_blank\">https://bit.ly/-HindiMovies</a><br />\n<br />\n► Watch Hindi Romantic Movies - <a href=\"https://bit.ly/HindiRomanticMovies\" target=\"_blank\">https://bit.ly/HindiRomanticMovies</a><br />\n<br />\n► Watch Hindi Action Movies - <a