(1485, 'Pyare Mohan (HD) - Full Movie - Vivek Oberoi- Fardeen Khan - Superhit Comedy Movie', '<p>Pyare (Fardeen Khan) is blind and Mohan (Vivek Oberoi) is deaf. Both friends seem to be happy even with their disabilities. They eventually come across Malhotra sisters Preeti (Esha Deol) and Priya (Amrita Rao). The men fall in love with them and begin to dream of a life with them. Unfortunately, the girls have the opposite feeling and see them only as friends. Preeti and Priya fly to Bangkok to do a song and dance show. But fate takes a twist on these sisters when underworld don Tony Fernandez kills a priest in the fight and the police suspects Malhotra sisters. But hilarious chaos begins when two former Bollywood stunt artistes, Pyare and Mohan intervene to save the Malhotra sisters. Watch how they come out of this trap. <br />\n<br />\nSUBSCRIBE to <a href=\"http://www.youtube.com/subscription_center?add_user=indiancomedy\" target=\"_blank\">http://www.youtube.com/subscription_cent...</a><br />\n<br />\nLike, Comment and Share this funny video with your friends and family. <br />\n<br />\nConnect with us on :- <br />\nFacebook - <a href=\"https://www.facebook.com/ShemarooEnt\" target=\"_blank\">https://www.facebook.com/ShemarooEnt</a><br />\nTwitter - <a href=\"https://twitter.com/ShemarooEnt\" target=\"_blank\">https://twitter.com/ShemarooEnt</a><br />\nGoogle+ -<a href=\"https://plus.google.com/+shemaroo\" target=\"_blank\">https://plus.google.com/+shemaroo</a> <br />\nPinterest - <a href=\"http://pinterest.com/shemaroo\" target=\"_blank\">http://pinterest.com/shemaroo</a><br />\n<br />\nSign up for Free and get daily updates on New Videos, exclusive Web Shows, contests & much more<br />\n<a href=\"http://youtube.shemaroo.com/default.aspx\" target=\"_blank\">http://youtube.shemaroo.com/default.aspx</a><br />\n<br />\nSend us your feedback and suggestions at : connect@shemaroo.com<br />\n<br />\nFor more Comedy Movies download the ShemarooMe app now and share it with