(1486, 'किसी से ना कहना (HD) - फ़ारुख़ शेख़ और दीप्ति नवल की सुपरहिट रोमांटिक कॉमेडी मूवी | उत्पल दत्त', '<p>Kailashnath is a widower, and father of an only son, Ramesh. He feels that his son has come of age, and must get married. He goes to see a number of young ladies for him, but is disappointed with them, as he feels they are too modern, speak English, and listen to foreign music. He feels that Ramesh will be better off marrying a non-English speaking lady, preferably from a small village. But the predicament of Ramesh is that he is already in love with Ramola, a very well qualified, English speaking Doctor, and he knows fully well that she will not be approved by his dad. So Ramesh, Ramola and Lalaji concoct a plot, making Ramola masquerade as a naive, non-English speaking village belle, with hilarious and unpredictable results.<br />\n<br />\nMovie:- Kissi Se Na Kehna (1983) | किसी से ना कहना <br />\nStarcast:- Farooq Sheikh, Deepti Naval, Utpal Dutt, Saeed Jaffrey, Deven Verma<br />\nDirected by:- Hrishikesh Mukherjee<br />\nProduced by:- Jaywant Pathare, Ashok Raut<br />\nMusic by:- Bappi Lahiri<br />\n<br />\n#KissiSeNaKehna #DeeptiNaval #HappyBirthdayDeeptiNaval #FarooqSheikh  #UtpalDutt <br />\n---------------------------------------------------------------------<br />\nEnjoy and stay connected with us!!<br />\n<br />\nSubscribe to Goldmines Bollywood:- <br />\n<a href=\"https://goo.gl/97SvE2\" target=\"_blank\">https://goo.gl/97SvE2</a><br />\n---------------------------------------------------------------------</p>', '181', 'hd', 'Dhamaal {HD} - 2007 - Sanjay Dutt - Arshad Warsi - Superhit Comedy Film', 'https://www.youtube.com/embed/uqnCt9H351E', '', '', 'https://i.ytimg.com/vi/uqnCt9H351E/mqdefault.jpg', 0, 25),
(1487, 'Toh Baat Pakki - Tabu - Ayub Khan - Sharman Joshi - Yuvika Chaudhary - Comedy Movie', '<p>Toh Baat Pakki is a story about a middle class woman Rajeshwari Saxena who wants to get her sister Nisha married to a rich guy. One day she meets a young guy named Rahul who is pursuing engineering. She takes this opportunity and rents off a room in her house so that love blossoms between Nisha and Rahul. Everything goes according to the plan until Rajeshwari meets Yuvraj who has a better financial status. Now that Rajeshwari has a better option for her sister she asks Rahul to vacate the room and rents the room to Vatsal. Later Rahul understands Rajeshwaris plan and beats at her own game and marries Nisha. <br />\n<br />\nSUBSCRIBE to <a href=\"http://www.YouTube.com/IndianComedy\" target=\"_blank\">http://www.YouTube.com/IndianComedy</a> <br />\n<br />\nLike, Comment and Share this funny video with your friends and family. <br />\n<br />\nConnect with us on :- <br />\nFacebook - <a href=\"https://www.facebook.com/ShemarooEnt\" target=\"_blank\">https://www.facebook.com/ShemarooEnt</a> <br />\nTwitter - <a href=\"https://twitter.com/ShemarooEnt\" target=\"_blank\">https://twitter.com/ShemarooEnt</a> <br />\nGoogle+ -<a href=\"https://plus.google.com/+shemaroo\" target=\"_blank\">https://plus.google.com/+shemaroo</a> <br />\nPinterest - <a href=\"http://pinterest.com/shemaroo\" target=\"_blank\">http://pinterest.com/shemaroo</a><br />\n<br />\nSign up for Free and get daily updates on New Videos, exclusive Web Shows, contests & much more<br />\n<a href=\"http://youtube.shemaroo.com/default.aspx\" target=\"_blank\">http://youtube.shemaroo.com/default.aspx</a><br />\n<br />\nSend us your feedback and suggestions at : connect@shemaroo.com<br />\n<br />\nFor more Comedy Movies download the ShemarooMe app now and share it with your friends and Family<br />\n<br />\nDownload the app now and share it with all the asli fans<br />\nAndroid: <a href=\"http://bit.ly/2K1lKfd\" targ