(1498, 'Johar Mehmood In Hong Kong (1971) Full Hindi Movie | Mehmood, Sonia Sahni, I.S. Johar, Aruna Irani', '<p>The film is the story of two conmen, Ramesh and Mahesh, whose only life purposes are to make the most money by cheating and theft. They land in the hands of a high-profile Portuguese dictator, who wants to blow up India with the formula of an atomic bomb, a Nuclear weapon developed by a scientist of Hong Kong, who is killed along with his daughter by high treasonous thieves in the hope of securing the formula, which, however, the scientist has already secured in a safe deposit locker in the Bank of Hong Kong. Coincidentally, the scientist’s daughter is a look-alike of a girl called Ms. Sonia / Usha Roy, who the dictator wants to act as the deceased patriotic daughter, go to the bank using her identity and take out the formula, to be later secured by him, and misused against India. For this, he makes Mr. Pran, his CID officer to be close to Sonia as her engaged partner, after she wins the Beauty contest of Miss Bombay. Simultaneously, he orders another of his cronies, Ramayan Tiwari, to pursue Ramesh and Mahesh, that they should also become the love interests of Sonia, so that she could be brought to Hong Kong on some pretext or the other. The story takes a turn when Mahesh really falls in love with Sonia, while posing as a blind man, out to win her sympathies, but not before she realizes the truth and is totally hurt, that he tried to cheat her as a blind man. Repentant Ramesh and Mahesh now becoming totally patriotic, decide to go to Honk Kong with Sonia and catch the culprits who want to inflict such drastic harm to India. How they manage to do this is a hilarious masterpiece, which can be understood only after watching the movie!<br />\n<br />\nMovie:- Johar Mehmood In Hong Kong (1971)<br />\nStarcast:- Mehmood, Sonia Sahni, I.S. Johar, Aruna Irani <br />\nDirected by:- S.A. Akbar <br />\nProduced by:- Madan Chopra & K.Z.Sheth<br />\nMusic by:- Kalyanji-Anandji<br />\n------------------------------------------------<br />\n<br />\nEnjoy and stay connected with us!!<br />\n<br />\nSubscribe to Goldmines Hindi:- <br />\n<a href=\"https://goo.gl/97SvE2\" target=\"_blank\">https://goo.gl/97SvE2</a><br />\n<br />\n---------------------------------------------------------------------</p>', '181', 'johar-mehmood-in-hong-kong-1971-full-hindi-movie-mehmood-sonia-sahni-i-s-johar-aruna-irani', 'Dhamaal {HD} - 2007 - Sanjay Dutt - Arshad Warsi - Superhit Comedy Film', 'https://www.youtube.com/embed/GGRkmWeKtTU', '', '', 'https://i.ytimg.com/vi/GGRkmWeKtTU/mqdefault.jpg', 0, 37),
